import React from 'react';

const Section = () => {
  return (
    <div className="nv-section" style={{ paddingTop: '90px', paddingBottom: '90px' }}>
      <div className="nv-container">
        <h1 className="nv-h--large">
          Experience the Future of Gaming with NVIDIA
        </h1>
        <p className="nv-text-large">
          Discover the power of real-time ray tracing, AI-powered DLSS, and revolutionary performance with our latest GeForce RTX graphics cards. Transform your gaming experience with cutting-edge technology designed for the most demanding games and creative applications.
        </p>
        <button className="nv-cta-secondary">
          Learn More
        </button>
      </div>
    </div>
  );
};

export default Section;
